	[100502] = {100502, 100502, 35, 6, 1, 0, 0, {}, {{effect_type=40,val=100502}}, 0, 0, {}, 0, 5, 0, 0, 1, 0, 2, {}, {}, "", 0, {}, "火车要经过的站点早已固定，而人生不是，它不断地去往未知的未来，也不会留下什么给现在。", "日记2", "《未来和现在》"},
