	[100505] = {100505, 100505, 35, 6, 1, 0, 0, {}, {{effect_type=40,val=100505}}, 0, 0, {}, 0, 5, 0, 0, 1, 0, 2, {}, {}, "", 0, {}, "昨天在电视里看到一个人在雨中伤心痛苦，那也许是为了让雨水冲刷所有的悲伤吧？", "日记5", "《悲伤》"},
	[100506] = {100506, 100506, 35, 6, 1, 0, 0, {}, {{effect_type=40,val=100506}}, 0, 0, {}, 0, 5, 0, 0, 1, 0, 2, {}, {}, "", 0, {}, "每次旅行时，背着你为我买的蓝色背包，就好像旅途永远有你在我的身旁。", "日记6", "《蓝色的背包》"},
	[100507] = {100507, 100507, 35, 6, 1, 0, 0, {}, {{effect_type=40,val=100507}}, 0, 0, {}, 0, 5, 0, 0, 1, 0, 2, {}, {}, "", 0, {}, "时间真是一种神奇的魔法，能够让陆地变为海洋，山川化为平地，也能抚平一个人内心的创伤。", "日记7", "《时间的魔法》"},
	[100508] = {100508, 100508, 35, 6, 1, 0, 0, {}, {{effect_type=40,val=100508}}, 0, 0, {}, 0, 5, 0, 0, 1, 0, 2, {}, {}, "", 0, {}, "我准备要回家啦。这一生即使我走得再远，见过再美的风景，都不及你身边的万分之一。", "日记8", "《最美的风景》"},
	[100509] = {100509, 100509, 35, 6, 1, 0, 0, {}, {{effect_type=40,val=100509}}, 0, 0, {}, 0, 5, 0, 0, 1, 0, 2, {}, {}, "", 0, {}, "虽然我经常把家里弄得乱七八糟，让家里的家具换了一套又一套，但你不会怪我的对吧？我最亲爱的主人。", "日记9", "《我知道》"},
	[100510] = {100510, 100510, 35, 6, 1, 0, 0, {}, {{effect_type=40,val=100510}}, 0, 0, {}, 0, 5, 0, 0, 1, 0, 2, {}, {}, "", 0, {}, "一只狗出去旅行，我也会突然想找个人说说话。但，这个人不会是别人，就是你。", "日记10", "《想说说话》"},
	[100511] = {100511, 100511, 35, 6, 1, 0, 0, {}, {{effect_type=40,val=100511}}, 0, 0, {}, 0, 5, 0, 0, 1, 0, 2, {}, {}, "", 0, {}, "人类好像说过“日有所思，夜有所梦”，那我每天经常会梦见你带着我出去玩算不算？", "日记11", "《日思夜梦》"},
