	[100513] = {100513, 100513, 35, 6, 1, 0, 0, {}, {{effect_type=40,val=100513}}, 0, 0, {}, 0, 5, 0, 0, 1, 0, 2, {}, {}, "", 0, {}, "有时候你说你想静一静，但我知道那会是你最需要我的时候。", "日记13", "《最需要的时候》"},
	[100514] = {100514, 100514, 35, 6, 1, 0, 0, {}, {{effect_type=40,val=100514}}, 0, 0, {}, 0, 5, 0, 0, 1, 0, 2, {}, {}, "", 0, {}, "主人你看，这个世界真大，无边无际。但是当我遇到你之后，我的世界就只有你了。", "日记14", "《我的世界》"},
	[100515] = {100515, 100515, 35, 6, 1, 0, 0, {}, {{effect_type=40,val=100515}}, 0, 0, {}, 0, 5, 0, 0, 1, 0, 2, {}, {}, "", 0, {}, "我还想趁年轻，多看看世界的风景。等我老一点，就一直待在你的身边，一直看着你。", "日记15", "《只有你》"},
	[100516] = {100516, 100516, 35, 6, 1, 0, 0, {}, {{effect_type=40,val=100516}}, 0, 0, {}, 0, 5, 0, 0, 1, 0, 2, {}, {}, "", 0, {}, "偶尔想到你，我也会张口大笑，也许在别人看来我的样子一定很傻吧？但我也没办法。", "日记16", "《傻傻的狗》"},
	[100517] = {100517, 100517, 35, 6, 1, 0, 0, {}, {{effect_type=40,val=100517}}, 0, 0, {}, 0, 5, 0, 0, 1, 0, 2, {}, {}, "", 0, {}, "想要的东西，岁月都能给予。但如果不去努力，大概连岁月也会把你想要的东西忘记。", "日记17", "《想要的东西》"},
	[100518] = {100518, 100518, 35, 6, 1, 0, 0, {}, {{effect_type=40,val=100518}}, 0, 0, {}, 0, 5, 0, 0, 1, 0, 2, {}, {}, "", 0, {}, "我相信所有经历都不是没有意义，就像我每次摔跤也一定是为了让我以后更好地奔跑。", "日记18", "《经历》"},
	[100519] = {100519, 100519, 35, 6, 1, 0, 0, {}, {{effect_type=40,val=100519}}, 0, 0, {}, 0, 5, 0, 0, 1, 0, 2, {}, {}, "", 0, {}, "人们不断地努力，都是为了强大到让世界无法改变自己，对吧？", "日记19", "《努力的意义》"},
	[100520] = {100520, 100520, 35, 6, 1, 0, 0, {}, {{effect_type=40,val=100520}}, 0, 0, {}, 0, 5, 0, 0, 1, 0, 2, {}, {}, "", 0, {}, "有时候我会想，我应该不会输的吧？因为我一直都想赢，只要我不认输，就不会输。", "日记20", "《输赢》"},
	[100521] = {100521, 100521, 35, 6, 1, 0, 0, {}, {{effect_type=40,val=100521}}, 0, 0, {}, 0, 5, 0, 0, 1, 0, 2, {}, {}, "", 0, {}, "我相信世界不会偏爱那些懒惰的人或者狗，也绝不会怠慢勤奋的那些。", "日记21", "《偏爱与怠慢》"},
	[100522] = {100522, 100522, 35, 6, 1, 0, 0, {}, {{effect_type=40,val=100522}}, 0, 0, {}, 0, 5, 0, 0, 1, 0, 2, {}, {}, "", 0, {}, "时间是最公平的东西，对于所有人来说每天都只有24小时，不多不少，不偏不倚。", "日记22", "《公平的时间》"},
	[100523] = {100523, 100523, 35, 6, 1, 0, 0, {}, {{effect_type=40,val=100523}}, 0, 0, {}, 0, 5, 0, 0, 1, 0, 2, {}, {}, "", 0, {}, "时间是最不公平的东西，所有人每天都拥有着同时的时间，最后却活成了不同的模样。", "日记23", "《不公平的时间》"},
	[100524] = {100524, 100524, 35, 6, 1, 0, 0, {}, {{effect_type=40,val=100524}}, 0, 0, {}, 0, 5, 0, 0, 1, 0, 2, {}, {}, "", 0, {}, "主人主人，我们都要努力呀，为了我们想要的生活。", "日记24", "《一起努力》"},
	[100525] = {100525, 100525, 35, 6, 1, 0, 0, {}, {{effect_type=40,val=100525}}, 0, 0, {}, 0, 5, 0, 0, 1, 0, 2, {}, {}, "", 0, {}, "努力并不一定会成功，但那段努力的时光一定会让我们看到更好的自己。", "日记25", "《努力的时光》"},
	[100526] = {100526, 100526, 35, 6, 1, 0, 0, {}, {{effect_type=40,val=100526}}, 0, 0, {}, 0, 5, 0, 0, 1, 0, 2, {}, {}, "", 0, {}, "当你认真起来的时候，全世界都会为你让出一条道路。", "日记26", "《认真》"},
	[100527] = {100527, 100527, 35, 6, 1, 0, 0, {}, {{effect_type=40,val=100527}}, 0, 0, {}, 0, 5, 0, 0, 1, 0, 2, {}, {}, "", 0, {}, "等待出来的是命运，拼搏出来的才是人生。", "日记27", "《命运与人生》"},
	[100528] = {100528, 100528, 35, 6, 1, 0, 0, {}, {{effect_type=40,val=100528}}, 0, 0, {}, 0, 5, 0, 0, 1, 0, 2, {}, {}, "", 0, {}, "我觉得你的未来肯定会很好，因为主人你的努力我一直都看在眼里。", "日记28", "《未来的模样》"},
	[100529] = {100529, 100529, 35, 6, 1, 0, 0, {}, {{effect_type=40,val=100529}}, 0, 0, {}, 0, 5, 0, 0, 1, 0, 2, {}, {}, "", 0, {}, "每个人心中总有一个太阳，你一直在我心中发着光。", "日记29", "《心中的太阳》"},
	[100530] = {100530, 100530, 35, 6, 1, 0, 0, {}, {{effect_type=40,val=100530}}, 0, 0, {}, 0, 5, 0, 0, 1, 0, 2, {}, {}, "", 0, {}, "等到所有风景都看透，我会陪你看细水长流。", "日记30", "《细水长流》"},
	[100531] = {100531, 100531, 35, 6, 1, 0, 0, {}, {{effect_type=40,val=100531}}, 0, 0, {}, 0, 5, 0, 0, 2, 0, 2, {}, {}, "", 0, {}, "愿你被打击时，记起你的珍贵，抵抗恶意；愿你在迷茫时，坚信你的珍贵，爱你所爱，行你所行，听从你心，无问东西。", "日记31", "《无问东西》"},
	[100532] = {100532, 100532, 35, 6, 1, 0, 0, {}, {{effect_type=40,val=100532}}, 0, 0, {}, 0, 5, 0, 0, 3, 0, 2, {}, {}, "", 0, {}, "主人你的人生故事开头也许充满坎坷，不过这并不影响你成为什么样的人。关键看你后来的人生路，你自己选择怎么走下去。", "日记32", "《坎坷》"},
	[100533] = {100533, 100533, 35, 6, 1, 0, 0, {}, {{effect_type=40,val=100533}}, 0, 0, {}, 0, 5, 0, 0, 4, 0, 2, {}, {}, "", 0, {}, "主人，你一定要尽全力保护你的梦想，那些嘲笑你的人，他们必定会失败，他们想把你变成和他们一样的人。有梦想，就要努力去实现。", "日记33", "《梦想》"},
	[100534] = {100534, 100534, 35, 6, 1, 0, 0, {}, {{effect_type=40,val=100534}}, 0, 0, {}, 0, 5, 0, 0, 5, 0, 2, {}, {}, "", 0, {}, "人生就像一盒巧克力，你永远不知道下一颗是什么味道。", "日记34", "《巧克力》"},
	[100535] = {100535, 100535, 35, 6, 1, 0, 0, {}, {{effect_type=40,val=100535}}, 0, 0, {}, 0, 5, 0, 0, 6, 0, 2, {}, {}, "", 0, {}, "主人，你是想放手一搏，还是等到年华老去，心中充满遗憾，孤独地迈向黄泉路?", "日记35", "《抉择》"},
	[100536] = {100536, 100536, 35, 6, 1, 0, 0, {}, {{effect_type=40,val=100536}}, 0, 0, {}, 0, 5, 0, 0, 7, 0, 2, {}, {}, "", 0, {}, "生活坏到一定程度就会好起来，因为它无法更坏。努力过后，才知道许多事情，坚持坚持。", "日记36", "《坚持》"},
	[100537] = {100537, 100537, 35, 6, 1, 0, 0, {}, {{effect_type=40,val=100537}}, 0, 0, {}, 0, 5, 0, 0, 8, 0, 2, {}, {}, "", 0, {}, "我们曾经仰望星空，思考我们在宇宙中的位置，而现在我们只会低着头，担心如何在这片土地上活下去。", "日记37", "《仰望》"},
	[100538] = {100538, 100538, 35, 6, 1, 0, 0, {}, {{effect_type=40,val=100538}}, 0, 0, {}, 0, 5, 0, 0, 9, 0, 2, {}, {}, "", 0, {}, "我们不能改变这个世界，但至少可以不被这个世界改变。", "日记38", "《改变》"},
	[100539] = {100539, 100539, 35, 6, 1, 0, 0, {}, {{effect_type=40,val=100539}}, 0, 0, {}, 0, 5, 0, 0, 10, 0, 2, {}, {}, "", 0, {}, "不要让别人告诉你，你不能做什么。只要有梦想，就要去追求。那些做不到的人总要告诉你，你也不行。想要什么就得去努力，去追求。", "日记39", "《追求》"},
	[100540] = {100540, 100540, 35, 6, 1, 0, 0, {}, {{effect_type=40,val=100540}}, 0, 0, {}, 0, 5, 0, 0, 11, 0, 2, {}, {}, "", 0, {}, "有人住高楼，有人在深沟，有人光万丈，有人一身锈，世人万千种，浮云莫去求，斯人若彩虹，遇上方知有。", "日记40", "《彩虹》"},
}
